export async function redirectToAuthCodeFlow(clientId) {
  const verifier = generateCodeVerifier(128);
  const challenge = await generateCodeChallenge(verifier);

  localStorage.setItem("verifier", verifier);

  const params = new URLSearchParams();
  params.append("client_id", clientId);
  params.append("response_type", "code");
  params.append("redirect_uri", "http://localhost:5173/callback");
  params.append(
    "scope",
    "playlist-modify-public playlist-modify-private user-read-private user-read-email ugc-image-upload"
  );
  params.append("code_challenge_method", "S256");
  params.append("code_challenge", challenge);

  document.location = `https://accounts.spotify.com/authorize?${params.toString()}`;
}

function generateCodeVerifier(length) {
  let text = "";
  let possible =
    "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";

  for (let i = 0; i < length; i++) {
    text += possible.charAt(Math.floor(Math.random() * possible.length));
  }
  return text;
}

async function generateCodeChallenge(codeVerifier) {
  const data = new TextEncoder().encode(codeVerifier);
  const digest = await window.crypto.subtle.digest("SHA-256", data);
  return btoa(String.fromCharCode.apply(null, [...new Uint8Array(digest)]))
    .replace(/\+/g, "-")
    .replace(/\//g, "_")
    .replace(/=+$/, "");
}

export async function getAccessToken(clientId, code) {
  const verifier = localStorage.getItem("verifier");

  const params = new URLSearchParams();
  params.append("client_id", clientId);
  params.append("grant_type", "authorization_code");
  params.append("code", code);
  params.append("redirect_uri", "http://localhost:5173/callback");
  params.append("code_verifier", verifier);

  const result = await fetch("https://accounts.spotify.com/api/token", {
    method: "POST",
    headers: { "Content-Type": "application/x-www-form-urlencoded" },
    body: params,
  });

  const { access_token } = await result.json();
  return access_token;
}

async function fetchSongs(token, seeds) {
  let result = await fetch(
    `https://api.spotify.com/v1/recommendations?limit=30&seed_genres=${seeds}`,
    {
      method: "GET",
      headers: { Authorization: `Bearer ${token}` },
    }
  );

  result = await result.json();

  let songs = [];
  for (let i = 0; i < 30; i++) {
    songs.push(result.tracks[i].uri);
  }

  return songs;
}

async function getProfile(token) {
  let result = await fetch(`https://api.spotify.com/v1/me`, {
    method: "GET",
    headers: { Authorization: `Bearer ${token}` },
  });

  result = await result.json();

  return result.id;
}

async function fetchWebApi(token, endpoint, method, body, check = false) {
  const res = await fetch(`https://api.spotify.com/${endpoint}`, {
    headers: {
      Authorization: `Bearer ${token}`,
    },
    method,
    body: JSON.stringify(body),
  });

  if (check) {
    return;
  }
  return await res.json();
}

async function createPlaylist(token, userID, genres, songs) {
  const playlist = await fetchWebApi(
    token,
    `v1/users/${userID}/playlists`,
    "POST",
    {
      name: "Custom Mylist",
      description: `This playlist is comprised of songs from ${genres.join(
        ", "
      )}`,
      public: false,
    }
  );

  await fetchWebApi(token, `v1/playlists/${playlist.id}/tracks`, "POST", {
    uris: songs,
    position: 0,
  });

  return playlist.id;
}

async function playlistCover(token, playlistID, index) {
  console.log(index);
  const result = await fetch(
    `https://api.spotify.com/v1/playlists/${playlistID}/images`,
    {
      method: "PUT",
      headers: {
        Authorization: `Bearer ${token}`,
        "Content-Type": "image/jpeg",
      },
      body: imageArray[index],
    }
  );
}

